import React from 'react';

import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';

import './Nav.scss';

const Navigation = function() {
    return (
        <Navbar expand="false">
            <Container>
                <Navbar.Brand href="#"></Navbar.Brand>
            </Container>
        </Navbar>
    )
}

export default Navigation;
